INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Qui debitis molestiae et labore.', 'Quam nesciunt blanditiis nulla rerum iusto voluptatum. Aut neque omnis autem similique voluptas assumenda quam. Porro nisi qui harum rerum commodi impedit. Quam quae velit libero at iste ab sapiente cum.', 'Numquam optio suscipit officia minus qui soluta aut. Quia eius officiis et ut earum. Est fugit reiciendis rerum molestiae. Temporibus voluptatem nobis tempora ab et.', '1992-02-14');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Quisquam dolores voluptates sit.', 'Rerum quaerat dolores omnis. Rem vel rerum non dignissimos. Nihil repellat et esse magni vel. Voluptas et voluptas vel ipsum voluptate commodi ab qui.', 'Dignissimos consequatur praesentium perferendis mollitia placeat et. Ut aut est pariatur quis iure vitae. Iusto ut quia quia fugiat minima saepe quia. Autem fugiat modi qui voluptas aut fuga dolores.', '1992-06-22');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Maxime cupiditate odio perferendis dicta voluptatem et debitis.', 'Dolore molestiae quo libero ut dignissimos est quo. Dolor et id harum odit et. Commodi et quas facilis nobis nihil eum ducimus.', 'Est excepturi voluptates voluptatem quo enim commodi qui. Deserunt nisi repellendus repellat quis esse voluptatem.', '2013-08-18');
